import React from 'react';
import { Container } from 'react-bootstrap';

function Dashboard() {
  return (
    <Container className="mt-5 text-white">
      <h1>Dashboard</h1>
      <p>Vitajte v aplikácii pre správu zamestnancov.</p>
    </Container>
  );
}

export default Dashboard;
